void __fastcall Hooks::Hooked_PaintTraverse(PVOID pPanels, int edx, unsigned int vguiPanel, bool forceRepaint, bool allowForce)
{
	
	static unsigned int panel_zoom = 0;
	if (!panel_zoom) {
		if (strstr(m_pPanels->GetName(vguiPanel), XorStr("HudZoom")))
			panel_zoom = vguiPanel;
	}
	else if (vguiPanel == panel_zoom) {
		if (Shonax::settingsxd.noscope)
			return;
	}


	g_fnOriginalPaintTraverse(pPanels, vguiPanel, forceRepaint, allowForce);

	static unsigned int OverlayerPan = 0;
	static bool FoundPanel = false;

	PCHAR panel_name = (PCHAR)m_pPanels->GetName(vguiPanel);

	if (!FoundPanel)
	{
		if (strstr(panel_name, XorStr("MatSystemTopPanel")))
		{
			OverlayerPan = vguiPanel;
			FoundPanel = true;
		}
	}
	else if (OverlayerPan == vguiPanel)
	{
		int W, H;
		m_pEngine->GetScreenSize(W, H);
		
		if (Shonax::settingsxd.watermark)
		{
			static float rainbow;
			rainbow += 0.005f;
			if (rainbow > 1.f) rainbow = 0.f;
			draw.text(W - 150, 19, "nnware", draw.fonts.indicator, Color::FromHSB(rainbow, 1.f, 1.f));
		}
		if (Shonax::settingsxd.FPS)
		{
			static float rainbow;
			rainbow += 0.005f;
			if (rainbow > 1.f) rainbow = 0.f;
			int w1, h1;
			m_pEngine->GetScreenSize(w1, h1);

			float fps = 1.f / m_pGlobals->absoluteframetime;
			int radix = 10;
			char buffer[20];
			char *FPS;

			FPS = itoa(fps, buffer, radix);

			draw.text(10, h1 / 2 - 40, ("FPS:"), draw.fonts.indicator, Color::FromHSB(rainbow, 1.f, 1.f));
			draw.text(60, h1 / 2 - 40, FPS, draw.fonts.indicator, Color::FromHSB(rainbow, 1.f, 1.f));

		}
		if (Shonax::settingsxd.PING)
		{
			static float rainbow;
			rainbow += 0.005f;
			if (rainbow > 1.f) rainbow = 0.f;
			int w1, h1;
			m_pEngine->GetScreenSize(w1, h1);

			int radix = 10;
			char buffer[20];

			auto nci = m_pEngine->GetNetChannelInfo();

			float ping = 1.f / nci->GetLatency(FLOW_INCOMING);
			char *PING;

			PING = itoa(ping, buffer, radix);

			draw.text(10, h1 / 2 - 20, ("Ping:"), draw.fonts.indicator, Color::FromHSB(rainbow, 1.f, 1.f));
			draw.text(60, h1 / 2 - 20, PING, draw.fonts.indicator, Color::FromHSB(rainbow, 1.f, 1.f));

		}
		if ( m_pEngine->IsConnected( ) && m_pEngine->IsInGame( ) )
		{
			static float rainbow;
			rainbow += 0.005f;
			if (rainbow > 1.f) rainbow = 0.f;
			if (Shonax::settingsxd.eventlogs) FEATURES::MISC::in_game_logger.Do();
			IClientEntity* m_local = game::localdata.localplayer( );

			

			if ( m_local )
			{
			//	bullet_impacts.paint( );
				esp.paint( );
				
				if (Shonax::settingsxd.esphitmarker)
					hitmarkers.Draw();
				//watermark

				
				{
					int W, H, cW, cH;
					m_pEngine->GetScreenSize(W, H);
					cW = W / 2;
					cH = H / 2;

					static bool left = false;
					static bool right = false;
					static bool back = false;
					if (m_pEngine->IsConnected() && m_pEngine->IsInGame())
					{
						
						if (Shonax::settingsxd.aimbot_enabled)
						{
							if (Shonax::settingsxd.manualangeflip && GetAsyncKeyState(Shonax::settingsxd.leftflip))
							{
								left = true;
								right = false;
								back = false;
							}
							else
							{ 
							}
							if (Shonax::settingsxd.manualangeflip && GetAsyncKeyState(Shonax::settingsxd.rightflip))
							{
								left = false;
								right = true;
								back = false;
								
							}
							else
							{
							}
							if (Shonax::settingsxd.manualangeflip && GetAsyncKeyState(Shonax::settingsxd.backflip))
							{
								left = false;
								right = false;
								back = true;
								
							}
							else
							{
							}
							{
								static float rainbow;
								rainbow += 0.005f;
								if (rainbow > 1.f) rainbow = 0.f;
								if (Shonax::settingsxd.manualangefliparrow)
								{
									if (left)
									{
										draw.text(W / 2 + 40, H / 2, ">", draw.fonts.aaindicator, Color(255, 255, 255, 255));
										draw.text(W / 2 - 40, H / 2, "<", draw.fonts.aaindicator, Color(10, 145, 190, 255));
										draw.text(W / 2, H / 2 + 40, "V", draw.fonts.aaindicator, Color(255, 255, 255, 255));
									}
									else if (right)
									{
										draw.text(W / 2 + 40, H / 2, ">", draw.fonts.aaindicator, Color(10, 145, 190, 255));
										draw.text(W / 2 - 40, H / 2, "<", draw.fonts.aaindicator, Color(255, 255, 255, 255));
										draw.text(W / 2, H / 2 + 40, "V", draw.fonts.aaindicator, Color(255, 255, 255, 255));
									}
									else if (back)
									{
										draw.text(W / 2 + 40, H / 2, ">", draw.fonts.aaindicator, Color(255, 255, 255, 255));
										draw.text(W / 2 - 40, H / 2, "<", draw.fonts.aaindicator, Color(255, 255, 255, 255));
										draw.text(W / 2, H / 2 + 40, "V", draw.fonts.aaindicator, Color(10, 145, 190, 255));
									}
								}
							}
						}
					}
				}
				
				if (Shonax::settingsxd.noscope && game::localdata.localplayer()->IsScoped())
				{
					int width, height;
					m_pEngine->GetScreenSize(width, height);

					Color line_color = Color(19, 19, 19, 255);

					if (game::globals.end_removed_scope_red > m_pGlobals->curtime)
						line_color = Color(255, 10, 10);

					draw.rect(width / 2, 0, 1, height, line_color);
					draw.rect(0, height / 2, width, 1, line_color);
				}
				crosshair.paint();
				damage_indicators.paint();

				static bool disabled_postprocessing = false;
				
				if (Shonax::settingsxd.disabieInterpolation && !disabled_postprocessing)
				{
					auto svcheats = m_pCVar->FindVar("sv_cheats");
					auto svcheatsspoof = new SpoofedConvar(svcheats);
					svcheatsspoof->SetInt(1);

					m_pEngine->ClientCmd_Unrestricted("mat_postprocess_enable 0");
					disabled_postprocessing = true;
				}
				
				if (!Shonax::settingsxd.disablepostprocess && disabled_postprocessing)
				{
					m_pEngine->ClientCmd_Unrestricted("mat_postprocess_enable 1");
					disabled_postprocessing = false;
				}
				
				if (Shonax::settingsxd.lbyindicator)
				{
					int width, height;
					m_pEngine->GetScreenSize(width, height);

					int aa_type;
					
					if (game::localdata.localplayer()->GetVelocity().Length() < 1)
						aa_type = Shonax::settingsxd.standaayaw;
					else
						aa_type = Shonax::settingsxd.moveaayaw;

					
					if (m_local->IsAlive()) {
						if (m_local->is_grounded() && m_local->GetVelocity().Length2D() > 0.1)
							game::globals.lby_update_end_time = m_pGlobals->curtime;

						if (game::globals.lby_update_end_time < m_pGlobals->curtime) {
							draw.text(10, height - (height / 12), "LBY", draw.fonts.indicator, Color(130, 241, 13));
						} else {
							draw.text(10, height - (height / 12), "LBY", draw.fonts.indicator, Color(255, 102, 102));
						}
					}
				}

				resolver.draw_developer_data();
			}
		}

		plist.update();
		Menu::DoFrame();
		settings.Update();
		wallmodulator.set_modulations();
	}
}


